        await TestBed.configureTestingModule({
            declarations: [SingleUserComponent]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(SingleUserComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
